import "./workList.css";
export const WorkListTemplate = ({
  addWakeTimeWindow,
  addWorkWindow,
  workList,
  addBedTimeWindow,
}) => {
  return (
    <div>
      <h1>Hamburger App</h1>
      {addWakeTimeWindow}
      {addWorkWindow}
      {workList}
      {addBedTimeWindow}
      <ol>
        <li>Wake Up at 08:00 </li>
        <li>Clean My room 3h </li>
        <li>Do My homework 3h 20m </li>
        <li>Test comment 2h 1m </li>
        <li>Sleep at 01:00 </li>
      </ol>
    </div>
  );
};
